import "./Product.css";

function Product() {
  return (
    <div className="product">
      <div className="product-info">
        <p className="product-title">Product description</p>
        <h4 className="product-price">Product price</h4>
      </div>
      <img src="" alt="Image of product" className="product-image">
        Image of Product
      </img>
      <button className="product-button">Add To Basket</button>
      <h1>Product</h1>
    </div>
  );
}

export default Product;
